import React from 'react';

const ModalName = ({ show, onClose }) => {
    if (!show) {
        return null;
    }

    return (
        <div className="modal-backdrop">
            <div className="modal-content">
                <button className="close-button" onClick={onClose}>X</button>
                <div>Всем привет!</div>
            </div>
        </div>
    );
};

export default ModalName;
